import logo from './assets/Logo.svg';
import Nav from "./Nav";
import './styles.css';
function Header() {
    return (
        <header className={"header-section"}>
            <img className={"header-logo"}src={logo} alt="Little Lemon Logo" width={"200px"} height={"96px"}/>
            <Nav section={"top-bar"} links={
                [
                    {anchor: "Home", href: "#"},
                    {anchor: "About", href: "#"},
                    {anchor: "Contact", href: "#"},
                    {anchor: "Blog", href: "#"},
                    {anchor: "Careers", href: "#"},
                    {anchor: "Support", href: "#"},
                ]
            } />
        </header>
    )
}
export default Header;
